DESCRIPTION:
Sveiki,

Norėčiau Jūsų pasiteirauti, ar turint leidimus ir korektiškai įrengtos rezervuotos parkavimo vietos adresu - Birželio 23-iosios g. 10a, prie &#34;Vilniaus krepšinio mokyklos&#34; pastato. Prisegu &#34;Rezervuota&#34; ženklų nuotraukas. Prašau jūsų atsakyti:

Ar vietos įrengtos laikantis Lietuvos Respublikos įstatymų ir teisės numatytų aktų;
Ar nuotraukose matomi &#34;Rezervuota&#34; ženklai atitinka LR įstatymų ir teisės aktų numatytą tvarką; 
Ar parkavimo vietos priklauso &#34;Vilniaus krepšinio mokyklai&#34;, ar vietos yra viešo naudojimo, prieinamos visiems.

Prašau išaiškinti situaciją ir jei ženklai sudėti nelegaliai, pasirūpinti, kad parkavimo vietos būtų prieinamas visiems naudotojams, o ne tik tiems, kurie nelegaliai pasistatė ženklus. Norėtūsi gyventi  modernioje Europietiškoje valstybėje, o ne kažkur, kur kiekvienas gali galvoti savo taisykles ir taikyti kitiems.

