Nu    n e s ą m o n ę      padarėt, ką aš dar galiu pasakyti:
<a href="https://tvarkaumiesta.lt/problem/159599" target="_blank">https://tvarkaumiesta.lt/problem/159599</a>
&#34;Tuo pačiu, vykdant pokyčius atsisakyta perteklinio horizontalaus ženklinimo - neįrenginėti dviračių pervažos Vokiečių ir Trakų gatvių sankirtoje, siekiant išvengti perteklinio apribojimo dviratininkams kertant gatvę judėti tik ja ir paliekant galimybę kirsti gatvę ir kitose vietose.&#34;

Jūs nesupratote, ar nenorite suprasti ką parašiau, daugiau neberašysiu, o bus pateiktos nuotraukos ir jeigu nebus atleistas nei vienas eismo priežiūros darbuotojas, tai bus kreiptasi į televiziją ir parodyti jūsų kompetenciją.
&#34;Atsakymas:
Dėkojame už kreipimąsi. Pakartotinai informuojame, kad atsižvelgiant į transporto srautų pralaidumo pokyčius po papildomų lentelių su žalia rodykle demontavimo bei papildomai atliktus eismo situacijų vertinimus grąžinti lentelės su žalia rodykle Jeruzalės – Mokyklos g. sankryžoje neplanuojama. Papildomai informuojame, kad šioje, kaip ir kitose Vilniaus miesto šviesoforais reguliuojamuose sankryžose yra taikomas adaptyvus, t. y. lankstus sankryžos valdymas, kuris .....&#34;
